import ReactDOM from 'react-dom'
import logo from './logo.svg';
import './App.css';
import Sidebuttons from './SideButtons.js';


const App = () => (
    <div className="App">
      <h1>Ben Lottes</h1>
      <div>
          <Sidebuttons button_text1="Home"  button_text2="Projects" button_text3="Experience" button_text4="Resume"/>
      </div>
    </div>
);

export default App;
